import Icon from '@ant-design/icons';
import React from 'react';
import svg from './svg';

export const DownIcon = (props?: any) => <Icon component={svg.DownSvg} {...props} />;
export const UpIcon = (props?: any) => <Icon component={svg.UpSvg} {...props} />;
